import React from 'react';
import ReactPlayer from 'react-player';

function ProductVideo ({videoURL, play}) {

    return (
        <div className="video-div">
            <ReactPlayer 
                url={videoURL}
                playing={play}
                controls={true}
                light={true}
                playIcon={<i class="fab fa-youtube"></i>}
                width={'600px'}
                height={'500px'}
                stopOnUnmount={true}
            />
        </div>
    )
}

export default ProductVideo;
